function findPrimeNumbers(arr) {
    if (arr.length !== 5) {
        console.error("Input array must contain 5 numbers.");
        return;
    }

    function isPrime(num) {
        if (num < 2) return false;
        for (let i = 2; i * i <= num; i++) {
            if (num % i === 0) return false;
        }
        return true;
    }

    arr.forEach(num => {
        if (isPrime(num)) {
            console.log(`The prime number found is: ${num}`);
            return; // break the loop if one prime number is found
        }
    });
}

// Example usage:
